@Override
public FieldIndexEnum getFieldEnum(FieldInfo fieldInfo) {
  final FieldIndexData fieldData = fields.get(fieldInfo);
  if (fieldData.coreIndex == null) {
    return null;
  } else {
    return new IndexEnum(fieldData.coreIndex);
  }
}

